import React from "react";
import add from "./pages/addproducts";
import {
  createBrowserRouter,
  RouterProvider,
  Route,
  Link,
  BrowserRouter,
} from "react-router-dom";


function App()
{
    return(
      <div className="App">
        <BrowserRouter>
        <Routes>
          <Route path="/" element={add}/>
        </Routes>
        </BrowserRouter>
      </div>

    );


}


export default App
